import React from 'react';

function Item(props) {
    // console.log(props)
    const { todo, changeTodoFinished } = props;
    return (
        <li>
            <label>
                <input type="checkbox" onChange={() => changeTodoFinished(todo.id, !todo.finished)}
                    checked={todo.finished} />
                <span>{todo.title}</span>
            </label>
            <button
                className="btn btn-warning"
            >
                删除
                </button>
        </li>
    )
}

export default Item
